import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from '../../components/layout/Header';
import Footer from '../../components/layout/Footer';

const Notifications = () => {
  const [activeTab, setActiveTab] = useState<'all' | 'unread'>('all');

  // Mock data
  const notifications = [
    {
      id: 1,
      type: 'application',
      title: 'Application Update',
      message: 'Your application for Senior Frontend Developer at Nomad has been reviewed',
      time: '2 hours ago',
      read: false,
      jobId: 1
    },
    {
      id: 2,
      type: 'interview',
      title: 'Interview Invitation',
      message: 'You have been invited for an interview at Discord for Full Stack Developer position',
      time: '1 day ago',
      read: false,
      jobId: 2
    },
    {
      id: 3,
      type: 'message',
      title: 'New Message',
      message: 'You have received a new message from GitHub regarding your application',
      time: '2 days ago',
      read: true,
      jobId: 3
    },
    {
      id: 4,
      type: 'job',
      title: 'New Job Match',
      message: 'A new job matching your profile has been posted: Backend Developer at Microsoft',
      time: '3 days ago',
      read: true,
      jobId: 4
    }
  ];

  const getNotificationIcon = (type: string) => {
    switch (type) {
      case 'application':
        return (
          <svg className="w-6 h-6 text-blue-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
          </svg>
        );
      case 'interview':
        return (
          <svg className="w-6 h-6 text-yellow-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" />
          </svg>
        );
      case 'message':
        return (
          <svg className="w-6 h-6 text-emerald-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 10h.01M12 10h.01M16 10h.01M9 16H5a2 2 0 01-2-2V6a2 2 0 012-2h14a2 2 0 012 2v8a2 2 0 01-2 2h-5l-5 5v-5z" />
          </svg>
        );
      case 'job':
        return (
          <svg className="w-6 h-6 text-purple-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 13.255A23.931 23.931 0 0112 15c-3.183 0-6.22-.62-9-1.745M16 6V4a2 2 0 00-2-2h-4a2 2 0 00-2 2v2m4 6h.01M5 20h14a2 2 0 002-2V8a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
          </svg>
        );
      default:
        return null;
    }
  };

  const filteredNotifications = notifications.filter(
    notification => activeTab === 'all' || !notification.read
  );

  return (
    <>
      <Header />
      <div className="min-h-screen bg-gray-50 py-8">
        <div className="container mx-auto px-4">
          <div className="flex justify-between items-center mb-8">
            <h1 className="text-3xl font-bold text-gray-900">Notifications</h1>
            <button className="px-4 py-2 bg-emerald-600 text-white rounded-lg hover:bg-emerald-700">
              Mark all as read
            </button>
          </div>

          <div className="bg-white rounded-lg shadow">
            <div className="border-b">
              <div className="flex">
                <button
                  className={`px-6 py-3 font-medium ${
                    activeTab === 'all'
                      ? 'text-emerald-600 border-b-2 border-emerald-600'
                      : 'text-gray-500 hover:text-gray-700'
                  }`}
                  onClick={() => setActiveTab('all')}
                >
                  All
                </button>
                <button
                  className={`px-6 py-3 font-medium ${
                    activeTab === 'unread'
                      ? 'text-emerald-600 border-b-2 border-emerald-600'
                      : 'text-gray-500 hover:text-gray-700'
                  }`}
                  onClick={() => setActiveTab('unread')}
                >
                  Unread
                </button>
              </div>
            </div>

            <div className="divide-y">
              {filteredNotifications.map((notification) => (
                <div
                  key={notification.id}
                  className={`p-4 ${
                    !notification.read ? 'bg-emerald-50' : ''
                  }`}
                >
                  <div className="flex items-start gap-4">
                    <div className="flex-shrink-0">
                      {getNotificationIcon(notification.type)}
                    </div>
                    <div className="flex-1">
                      <div className="flex justify-between items-start">
                        <h3 className="font-semibold text-gray-900">{notification.title}</h3>
                        <span className="text-sm text-gray-500">{notification.time}</span>
                      </div>
                      <p className="mt-1 text-gray-600">{notification.message}</p>
                      <div className="mt-3">
                        <Link
                          to={`/jobs/${notification.jobId}`}
                          className="text-sm text-emerald-600 hover:text-emerald-700"
                        >
                          View Details
                        </Link>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default Notifications;
